column1:
Input: Construct a complete truth table for the following argument. Then, using the truth table, determine whether the argument is valid or invalid. If the argument is invalid, choose an option which presents a counterexample. (There may be other counterexamples as well.)
~K ≡ L / (K · L) ∨ (K · ~L) Choices: a) Valid b) Invalid. Counterexample when K and L are true c) Invalid. Counterexample when K is true and L is false d) Invalid. Counterexample when L is true and K is false 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Everybody loves Raymond, or not. Choices: a) L b) ~L c) L • ~L d) L ∨ ~L 
Output: {'sol': 'd'}

Input:  Construct a complete truth table for the following pairs of propositions. Then, using the truth tables, determine whether the statements are logically equivalent or contradictory. If neither, determine whether they are consistent or inconsistent. Justify your answers.
(~M ⊃ ~N) ∨ (O ≡ N) and (~M · N) · [(~O ∨ ~N) · (O ∨ N)] Choices: a) Logically equivalent b) Contradictory c) Neither logically equivalent nor contradictory, but consistent d) Inconsistent 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Pablo will go to the store if, and only if, his brother drives him and pays for gas. Choices: a) (P ≡ D) ≡ G b) (D • G) ⊃ P c) P ⊃ (D • G) d) P ≡ (D • G) 
Output: {'sol': 'd'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
The restaurant serves pie or cheesecake or ice cream for dessert. Choices: a) P ∨ (C ∨ I) b) (P ∨ C) ∨ I c) P ∨ C ∨ I d) Options A and B 
Output: {'sol': 'a'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
If Beth rides her bike, she gets to work earlier. Choices: a) B ⊃ W b) W ⊃ B c) B ≡ W d) Both A and B 
Output: {'sol': 'a'}

Input:  Construct a complete truth table for the following pairs of propositions. Then, using the truth tables, determine whether the statements are logically equivalent or contradictory. If neither, determine whether they are consistent or inconsistent. Justify your answers.
C ⊃ (D ∨ C) and C · ~D Choices: a) Logically equivalent b) Contradictory c) Neither logically equivalent nor contradictory, but consistent d) Inconsistent 
Output: {'sol': 'a'}

Input:  Construct a complete truth table for the following pairs of propositions. Then, using the truth tables, determine whether the statements are logically equivalent or contradictory. If neither, determine whether they are consistent or inconsistent. Justify your answers.
~O ⊃ P and O ∨ P Choices: a) Logically equivalent b) Contradictory c) Neither logically equivalent nor contradictory, but consistent d) Inconsistent 
Output: {'sol': 'a'}

Input:  Construct a complete truth table for the following pairs of propositions. Then, using the truth tables, determine whether the statements are logically equivalent or contradictory. If neither, determine whether they are consistent or inconsistent. Justify your answers.
I ≡ ~H and ~(~I ≡ H) Choices: a) Logically equivalent b) Contradictory c) Neither logically equivalent nor contradictory, but consistent d) Inconsistent 
Output: {'sol': 'a'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Either England's importing beef is a sufficient condition for France's subsidizing agriculture, or China doesn't promote human rights when and only when South Africa supplies diamonds. Choices: a) (E ⊃ F) ∨ (~C ⊃ S) b) (F ⊃ E) ∨ (S ⊃ ~C c) (E ⊃ F) ∨ ~(S ≡ C) d) (E ⊃ F) ∨ (~C ≡ S) 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
A person is considered to have lived with you for all of the present year if the person was born or died in the present year and your home was this person's home for the entire time this person was alive. Choices: a) (B ∨ D) • H ⊃ L b) L ⊃ (B ∨ D) • H c) L ⊃ (B ∨ D) • H d) (B ∨ D • H) ⊃ L 
Output: {'sol': 'b'}

Input: Construct a complete truth table for the following argument. Then, using the truth table, determine whether the argument is valid or invalid. If the argument is invalid, choose an option which presents a counterexample. (There may be other counterexamples as well.)
(O ≡ P) ∨ P / P ∨ ~O Choices: a) Valid b) Invalid. Counterexample when O and P are true c) Invalid. Counterexample when O is true and P is false d) Invalid. Counterexample when P is true and O is false 
Output: {'sol': 'a'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
If either George enrolls or Harry enrolls, then Ira does not enroll. Choices: a) (G ⊃ H) ∨ I b) (G ∨ H) ⊃ I c) (G ⊃ H) ∨ ~I d) (G ∨ H) ⊃ ~I 
Output: {'sol': 'd'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Either England's importing beef is not a necessary condition for France's subsidizing agriculture, or China promotes human rights if South Africa supplies diamonds. Choices: a) (~F ⊃ E) ∨ (C ≡ ~S) b) (~E ⊃ F) ∨ (C ⊃ S) c) (~F ⊃ E) ∨ (C ≡ S) d) ~(F ⊃ E) ∨ (S ⊃ C) 
Output: {'sol': 'a'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Brittany likes fish and lizards, but not cats. Choices: a) F • L • ~C b) (F • L) • ~C c) (F • L) ∨ ~C d) C • (F • L) 
Output: {'sol': 'b'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
If either Harry enrolls or George does not enroll, then Jim enrolls. Choices: a) H ∨ (~G ⊃ J) b) ~(H ∨ G) ⊃ J c) (H ∨ ~G) ⊃ J d) (H ⊃ ~G) ∨ J 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Doctors are helpful unless their patients are rude. Choices: a) H ≡ R b) H • R c) H ∨ ~R d) H ∨ R 
Output: {'sol': 'c'}

Input:  Construct a complete truth table for the following pairs of propositions. Then, using the truth tables, determine whether the statements are logically equivalent or contradictory. If neither, determine whether they are consistent or inconsistent. Justify your answers.
(G ∨ ~H) ⊃ G and ~G ≡ (~H · G) Choices: a) Logically equivalent b) Contradictory c) Neither logically equivalent nor contradictory, but consistent d) Inconsistent 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Either England's importing beef is a necessary condition for France's subsidizing agriculture or China's promoting human rights is not a sufficient condition for South Africa's supplying diamonds. Choices: a) (E ≡ F) ∨ ~(C ≡ S) b) (E ≡ F) ∨ (~C ⊃ S) c) (E ⊃ F) ∨ ~(C ⊃ S) d) (F ⊃ E) ∨ ~(C ⊃ S) 
Output: {'sol': 'c'}

Input:  Construct a complete truth table for the following pairs of propositions. Then, using the truth tables, determine whether the statements are logically equivalent or contradictory. If neither, determine whether they are consistent or inconsistent. Justify your answers.
~(J ∨ K) · L and (L ⊃ J) · K Choices: a) Logically equivalent b) Contradictory c) Neither logically equivalent nor contradictory, but consistent d) Inconsistent 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Either England's importing beef is a necessary condition for France's subsidizing agriculture or China promotes human rights given that South Africa doesn't supply diamonds. Choices: a) (E ⊃ F) ∨ (C ≡ ~S) b) (F ⊃ E) ∨ (~S ≡ C) c) (E ⊃ F) ∨ (S ⊃~C) d) (F ⊃ E) ∨ (~S ⊃ C) 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Either England's importing beef is a sufficient condition for France's subsidizing agriculture or China's promoting human rights is a necessary condition for South Africa's supplying diamonds. Choices: a) (E ⊃ F) ∨ (S ⊃ C) b) (F ⊃ E) ∨ (C ⊃ S) c) (E ⊃ F) ∨ (C ⊃ S) d) (F ⊃ E) ∨ (S ⊃ C) 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Dylan likes neither math nor science. Choices: a) M ∨ S b) ~(M • S) c) ~(M ∨ S) d) ~M ∨ ~S 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Since the university raised tuition, the president approved of it and the board didn't prevent it. Choices: a) (P • ~B) ⊃ U b) (U ⊃ P) • B c) U ⊃ (P • ~B) d) U ⊃ (P ∨ ~B) 
Output: {'sol': 'c'}

Input:  Which of the given formulas of PL is the best symbolization of the following sentence?
Either England's not importing beef is a necessary condition for France's subsidizing agriculture, or China promotes human rights if and only if South Africa doesn't supply diamonds. Choices: a) (F ⊃ ~E) ∨ (C ≡ ~S) b) (~E ⊃ F) ∨ (C ⊃ ~S) c) ~(F ⊃ E) ∨ (~S ⊃ C) d) (F ⊃ E) ∨ (C ≡ ~S) 
Output: {'sol': 'a'}
